import './AmazingNumberButton.css';


const ButtonNumber = (props) => { 
    return (
    <div>
     <table>
        <tr>
        <td id = "1" className = "btn-style">1</td>
        <td id = "2" className = "btn-style">2</td>
        <td id = "3" className = "btn-style">3</td>
        </tr>
    </table>
    </div>

    )
  }

export default ButtonNumber;
